{
  "advertisements": [
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "1. Bey wem extra schöne frische Damascener Meerdauben ohne Kammen in billigem Preiss und beliebiger Quantität zu haben, ist im Berichtshaus ohne Entgelt zu vernehmen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "2. Ein schönes Kanzleilin; Item ein Schleifsstein mit einem Stock in billigem Preiss, im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "3. Jetz jungst, wegen der Luftwaage sind frische angelaufne gute Dichtings in billigem Preiss zu haben."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "4. Im Gasthof zur Blumen ist guter alter Honig zu 28 kr. das Pfund zu haben, Item eine schöne gelbe Weiden in der Semine."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "5. Bey wem schöne gelbe, weisse und schächtige Canarien-Vögel in Mann, Weibch. in billigem Preiss zu haben, ist im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "6. Acht Saum guter rother alter Landwein à 10 Pfund der Saum. Solle et aber zugleich mit Wägen abgenommen werden à 9 Pfund, nebst einem 36 Stücken, gern auf einmal abzugeben; Er wäre tauglich für einen Wirth in eine Stadt oder auf der Landschaft, wovon Muster zu haben bey Herrn Hans Jacob Linck bey dem Zucker in der kleinen Stadt, leydet aber nicht lang Verzug."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "7. Es ist zu Entwinden ein Saft und ungefähr 3 Saum rother Strassburger-Wein von 1753, oder mit einander gemischt haben kann, zu einem nach dem billigen Werth stehenden Preiss."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "8. Ein Stuck schöne dreifach unterschneidtes Emdit schön gemach von Rieperer-Holz, wovon sich itzt dar bey dem Hrn. Appellations-Rath Hohlyzer auf dem Melberg anzumelden."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "9. Eine Büffet-Uhr mit einer Feder und schönen Gehäus; die 8 Tag geht und Viertel repetirt, in billigem Preiss, im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "10. Zehen Saum weisser Margrafer Wyler-Wein von 1753, in billigem Preiss, im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "11. Eine schöne ausklappbare Bettladen für 2 Personen; mit dem Gehäus. Item eine Tafel von einem schönen Holz, schwarz angestrichen, mit einem eingerahmten Schloß und Schlüsseln zu einem nach dem billigen Werth stehenden Preiss; Item ein grüner Sammet auf einer Spange zu haben, auf einem grünen Hut, à 5 kr. das Stück. Ein geschickter Vater kann 2 Stühle, Seil, Schrauben, Stein und Zugehör; Item eine verschlossene Calcedonie soll auch die eine eiserne Rücklehne umfassen; Also woselbst neue und schöne silberne Ohren-Spangen und eine Kette; Seil und Stein, alles zu billigem Preiss im Berichtshaus ohne Entgelt zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "12. Bey Meister Daniel Hüfster im Doctor-Garten sind schöne Rannunkeln & Wurzen und auch Gold-Lilien oder Narcissus Indicus Jacobus in billigem Preiss zu haben."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "13. Ein modnisches tuchenes Kleid in billigem Preiss im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "14. 50 schönen Wetter eingemachtes Heu und dito Emdit vom vorigen Jahr, in billigem Preiss, im Berichtshaus zu erfagen."
    },
    {
      "date": "1762-02-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "ntokens": null,
      "text": "15. Wie folgende Bücher zu haben, ist im Berichtshaus zu erfagen: Winterers Cosmographische Handes allgemeine Chronica, Hedingers Liederhistorie, Joseph Simlers Geschicht von Schleichshistorie, alles wohl gebunden, im Berichtshaus zu erfagen."
    }
  ]
}
